import React, { useEffect } from 'react'
import "./dashboard.scss"
const CountTotalRequest = () => {
    const [totalRequest, setTotalRequest] = useState();

    useEffect(() => {
        const fetchRequest = async () => {
            try {
                await axios
                    .get("https://tutorhelper20210920193710.azurewebsites.net/api/v1/tutor-requests", {
                        params: {
                            PageSize: 100,
                        }
                    })
                    .then((response) => {
                        setTotalRequest(response.data.data.length);
                    });
            } catch (error) {
                console.log(error);
            }
        }
        fetchRequest();
    }, []);
    return (
        <div>
            {totalRequest}
        </div>
    )
}


export default CountTotalRequest
